DROP TABLE IF EXISTS `bg_area_code`;
CREATE TABLE `bg_area_code`  (
  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `AREA_CODE` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '地区编码',
  `AREA_ENG` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '地区英文',
  `AREA_NAME` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '地区名称',
  `COUNTRY_CODE` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '国家编码',
  `COUNTRY_ENG` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '国家英文',
  `COUNTRY_NAME` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '国家名称',
  `PROVINCE_ENG` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '省级英文',
  `PROVINCE_NAME` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '省级名称',
  `PARENT_ENG` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '父级英文',
  `PARENT_NAME` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '父级名称',
  `LON` double(10, 4) NULL DEFAULT NULL COMMENT '经度',
  `LAT` double(10, 4) NULL DEFAULT NULL COMMENT '纬度',
  `makedate` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建日期',
  `modifydate` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新日期',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `area_name_index`(`AREA_NAME`) USING BTREE COMMENT '给城市名称添加索引'
) ENGINE = InnoDB AUTO_INCREMENT = 3182 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

